import React from 'react';
import SQLHeroLogo from '../../assets/images/database.svg';

function MainNav() {
    return (
        <nav>
            <p className='font-bold'>Logo</p>
            <ul>
                <li>
                    <a href=''><img src={SQLHeroLogo} alt='SQL Hero Logo' className='w-5' /></a>
                </li>
            </ul>
        </nav>
    );  
}

export default MainNav;
